int main(void)
{	
	total_score = 0;
    life_amount = 5;
    crystalList = (struct Crystal **)malloc(numCrystals * sizeof(struct Crystal *));
    for(int i = 0; i < numCrystals; i++){
        crystalList[i] = (struct Crystal *)malloc(sizeof(struct Crystal));
    }


    set_crystals(crystalList); // This populates the crystalList array with random parameters
	
    //setup led
	volatile int* LED = (int*) 0xFF200000;
    *(LED) = 0b0000011111; 
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    // declare other variables(not shown)
    // initialize location and direction of rectangles(not shown)


    /* set front pixel buffer to Buffer 1*/
    *(pixel_ctrl_ptr + 1) = (int) &Buffer1; // first store the address in the  back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer

    /* set back pixel buffer to Buffer 2 */
    *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	
	volatile int * pushButtonBase = (int *)0xFF200050; // pointer to base register of pushbuttons
    *(pushButtonBase+3) = *(pushButtonBase+3); //reset push buttons
	hookInfo.angle = 0;
	hookInfo.length = 35;
	
    //check if fourth push button clicked, if yes, start game
    
    while(1){
        while(1){ //loop until fourth button clicked
            initialPageState(); //display initial page
            if((*(pushButtonBase+3)>>3)%2 == 1){
                *(pushButtonBase+3) = *(pushButtonBase+3);
                clear_screen();
                break; //go to game screen
            }
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        }
        while(life_amount>0){  //keep playing game if life greater than 0
            playGameState(crystalList, pushButtonBase);
            
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        }
        printf("Current Highest Score is: %d\n", max_score);
        printf("Your score is: &d\n", curr_score);
        while(1){
            endGameState();//display end game state
            if(*(pushButtonBase+3)>>3%2==1){
                *(pushButtonBase+3) = *(pushButtonBase+3);
                clear_screen();
                break;
            }
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        }
        
    }
}

